import React from 'react';
import Content from './components/Content';
import logo from './assets/logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1 style={{ textAlign: 'center', marginTop: '30px' }}>공주의 콘텐츠 링크</h1>

      <Content
        image={logo}
        title="첫 번째 링크"
        description="클릭하면 foodroad.org로 이동해요!"
        link="https://foodroad.org"
      />

      <Content
        image="https://via.placeholder.com/200/FFC0CB/000000?text=공주+2"
        title="두 번째 링크"
        description="공주의 두 번째 콘텐츠 링크예요!"
        link="https://naver.com"
      />
    </div>
  );
}

export default App;
